{"thumbs":"","arrows":".academia.tparrows {
	cursor:pointer;
	background:#000;
	background:rgba(0,0,0,0.7);
	width:50px;
	height:60px;
	position:absolute;
	display:block;
	z-index:100;
    -webkit-transition: all .3s !important;
	-moz-transition: all .3s !important;
	-o-transition: all .3s !important;
	transition: all .3s !important;
}
.academia.tparrows:hover {
	background:#FFBC33;
}
.academia.tparrows:hover.tp-leftarrow:after
{
	border-top: solid 60px #FFBC33;
    opacity: 1;
}
.academia.tparrows:hover.tp-rightarrow:after
{
	border-bottom: solid 60px #FFBC33;
    opacity: 1;
}
.academia.tparrows:before {
	font-family: \"revicons\";
	font-size:18px;
    font-weight:600;
	color:#fff;
	display:block;
	line-height: 60px;
	text-align: center;
}
.academia.tparrows.tp-leftarrow:before {
	content: \"\\e824\";
}
.academia.tparrows.tp-rightarrow:before {
	content: \"\\e825\";
}
.academia.tparrows:after
{
	content: \'\';
    display: block;
    position: absolute;
    top: 0;
    bottom: 0;
    opacity: 0.7;
    -webkit-transition: all .3s !important;
	-moz-transition: all .3s !important;
	-o-transition: all .3s !important;
	transition: all .3s !important;
}
.academia.tparrows.tp-leftarrow:after{
    border-bottom: solid 0 transparent;
    border-top: solid 60px #000000;
    border-right: solid 10px transparent;
    left: 100%;
}
.academia.tparrows.tp-rightarrow:after{
	border-bottom: solid 60px #000000;
    border-top: solid 0 transparent;
    border-left: solid 10px transparent;
    right: 100%;
}
","bullets":".academia.tp-bullets {
}
.academia.tp-bullets:before {
	content:\" \";
	position:absolute;
	width:100%;
	height:100%;
	background:transparent;
	padding:10px;
	margin-left:-10px;margin-top:-10px;
	box-sizing:content-box;
}
.academia .tp-bullet {
	width:12px;
	height:12px;
	position:absolute;
	background:#aaa;
    background:rgba(125,125,125,0.5);
	cursor: pointer;
	box-sizing:content-box;
}
.academia .tp-bullet:hover,
.academia .tp-bullet.selected {
	background:rgb(125,125,125);
}
